    <style>
      body {
          margin: 0;
          font-family: "sofia-pro", sans-serif;
          box-sizing: border-box;
      }

      body * {
        font-family: "sofia-pro", sans-serif;
      }
      .fr-modal-screen {
          position: fixed;
          z-index: 99999999;
          left: 0;
          top: 0;
          width: 100%;
          height: 100%;
          background-color: rgba(0,0,0,0.4);
          overflow: hidden;
      }
      .fr-modal {
          background-color: #FFF;
          margin: 80px auto;
          width: 90%;
          max-width: 640px;
          border-radius: 12px;
          font-size: 16px;
          color: #212121;
          display: flex;
          flex-direction: column;
          max-height: calc(100vh - 160px);
      }
      /* HEADER */
      .fr-modal-header-row {
          display: flex;
          padding: 20px;
          flex-direction: row;
          align-items: center;
          justify-content: center;
          border-bottom: 1px solid #EEE;
          background: #FEFEFE;
          border-top-right-radius: 12px;
          border-top-left-radius: 12px;
      }
      .fr-modal-logo {
          height: 24px;
          margin: 0 auto;
      }
      .fr-modal-logo>a>svg {
        height: 24px;
      }

      .fr-back-icon, .fr-close-icon {
        border: none;
        padding: 0;
      }

      .fr-close-icon {
          display: inline-flex;
          justify-content: center;
          align-items: center;
          padding: 11px;
          border-radius: 100px;
          float: right;
          background-color: transparent;
          cursor: pointer;
      }
      .fr-back-icon {
        display: inline-flex;
        justify-content: center;
        align-items: center;

        border-radius: 100px;

        width: 32px;
        height: 32px;
        overflow: hidden;

        float: left;
        background-color: transparent;

        cursor: pointer;
      }
      .fr-close-icon>svg {
          height: 10px;
          width: 10px;
      }
      .fr-back-icon:hover, .fr-back-icon:focus, .fr-close-icon:hover, .fr-close-icon:focus {
          background-color: #E0E0E0;
      }
      .fr-link-vector {
        display: inline-block;
        position: relative;
        bottom: -2px;
        margin-left: 6px;
      }
      /* CONTENT */
      .fr-modal-content {
          overflow-y: auto;
          border-radius: 12px;
          height: 553px;
          padding: 0 24px;
          padding-bottom: 32px;
      }
      .fr-note-header {
          display: flex;
          align-items: center;
          justify-content: center !important;
          gap: 24px;
          padding: 24px 0;
      }
      .fr-doctor-title {
        font-size: 20px;
        font-style: normal;
        font-weight: 600;
        line-height: normal;
        margin: 0;
      }
      dl {
          display: flex;
          flex-direction: column;
      }
      dt, dd {
          padding-top: 14px;
          padding-bottom: 14px;
      }
      dd {
          margin: 0;
          text-align: right;
          padding-left: 20px;
      }

      .website a {
        color: currentcolor;
        line-height: normal;
      }

      dl > div {
        width: 100%;
        border-bottom: 1px solid #EEE;
        display: grid;
        grid-template-columns: auto 1fr;
      }

      dl > div:has(> dd:empty) {
        display: none;
      }

      .images {
        position: relative;
      }

      .images div.placeholder {
        display: none;
        border: none !important;
      }

      .images.mural-placeholder div.placeholder {
        display: flex;
      }

      .mural-1 {
        width: 56px;
        height: 56px;
      }

      .mural-1.mural-placeholder div.placeholder {
        width: 56px;
        height: 56px;
      }

      .mural-1 img {
        position: relative !important;
        width: 100%;
        height: 100%;
        border-radius: 24px !important;
      }

      .mural-1 div.placeholder {
        position: relative !important;
        width: 100%;
      }

      .images img {
        position: absolute;
        border-radius: 100px;
        background-color: #F5F5F5;
        object-fit: cover;
      }

      div.placeholder {
        position: absolute;
        border-radius: 100px;
      }

      @media only screen and (max-width: 480px) {
          .fr-modal {
              margin: 40px auto 80px;
          }
      }
    </style>
    <script>
      function frTrack(event, opts) {
        fetch("/api/tracking", {
          method: "POST",
          body: JSON.stringify({
            event, opts
          }),
          headers: {
            "Content-type": "application/json; charset=UTF-8"
          }
        });
      }

      function closeFrontrowModal() {
        window.parent.postMessage("CLOSE_PROVIDER_PROFILE", "*")
      }

      function trackClickToMarketingSite() {
        frTrack('widget_dialog_click_marketing_site_link', {
          healthBrandProductId: 1754,
          presentationType: 'quant',
        });
      }

      function closeAll() {
          frTrack('close_all_widget_dialogs', {
              healthBrandProductId: 1754,
              presentationType: 'quant',
          });
        window.parent.postMessage("CLOSE_ALL_MODALS", "*")
      }

      document.addEventListener('keydown', (event) => {
        if (event.key === 'Escape') {
          closeAll();
        }
      });

      window.addEventListener("message", (ev) => {
        if(ev.data.name != "OPEN") return;

        const {name, images, website, totalProviders: tp, ...data} = ev.data.data

        const totalProviders = parseInt(tp, 10)

        Object.keys(data).forEach(k => {
          const el = document.querySelector(`dd.${k}`)
          if(el) el.textContent = data[k]
        })

        document.querySelector(".fr-doctor-title").textContent = name;

        const websiteEl = document.querySelector("div.website")
        if(website) {
          const link = document.querySelector("dd.website a")
          websiteEl.style.display = "grid"
          link.href = website
        } else {
          const websiteEl = document.querySelector("div.website")
          websiteEl.style.display = "none"
        }

        const imagesUrls = (images || "").split(",").filter(s => s.startsWith("http"))
        let imagesContainer = document.querySelector("div.images")

        imagesContainer.innerHTML = `<div class="placeholder"><svg xmlns="http://www.w3.org/2000/svg" width="67" height="56" viewBox="0 0 67 56" fill="none">
                <rect x="3" y="-2.5" width="61" height="61" rx="26.5" fill="#EEEEEE" stroke="white" stroke-width="5"/>
                <mask id="mask0_2612_3189" style="mask-type:alpha" maskUnits="userSpaceOnUse" x="5" y="0" width="57" height="56">
                  <rect x="5.5" width="56" height="56" rx="24" fill="#D9D9D9"/>
                </mask>
                <g mask="url(#mask0_2612_3189)">
                  <path d="M33.5 32C39.8538 32 45 26.8538 45 20.5C45 14.1462 39.8538 9 33.5 9C27.1462 9 22 14.1462 22 20.5C22 26.8538 27.1462 32 33.5 32ZM33.5 36.75C25.8237 36.75 10.5 40.6025 10.5 48.25V58H56.5V48.25C56.5 40.6025 41.1763 36.75 33.5 36.75Z" fill="#E0E0E0"/>
                </g>
              </svg></div>`
        imagesContainer = document.querySelector("div.images")
        imagesContainer.className = imagesContainer.className.replace(/(^|\s)mural-\S+/g, "")


        imagesContainer.classList.add("mural-1")
        if(imagesUrls.length === 0) {
          imagesContainer.classList.add("mural-placeholder")
          return;
        } else {
          const imgP = document.createElement("img")
          imgP.src = imagesUrls[0]
          imagesContainer.append(imgP)
        }

      })

      window.addEventListener("message", (ev) => {
        if(ev.data.name === "UPDATE_UTM_PARAMS") {
          const linkEl = document.getElementById('link-to-marketing-site');
          if (linkEl) {
            const url = new URL(linkEl.href);
            url.searchParams.set('utm_content', ev.data.utm_content);
            linkEl.href = url.toString();
          }
        }
      });
    </script>
